import bgimage from "../images/story.jpg";
import bigarrow from "../images/bigarrow.svg"
import MyButton from "./MyButton";
const StoryProducts = () => {
  return (
    <section className="bg-[#FAF6EE] pt-1 pb-40 border-b border-[#111010]">
      <div className="container">
        <div className="relative mb-[152px]">
          <img className="object-cover rounded-[20px]" src={bgimage} alt="bgimage" />
          <div className="absolute top-0 p-14 text-8xl uppercase text-white lg:text-4xl xl:text-6xl">products <br />with a story</div>
          <button className="rounded-[50%] bg-[#F1EBE4] absolute py-[30px] px-[53px] right-16 bottom-[-64px] lg:bottom-[-56px] border-black border animate-pulse lg:py-5 lg:px-11 hover:animate-none" ><img src={bigarrow} alt="bigarrow" /></button>
          <MyButton absolute={true}>watch our studio tour</MyButton>
        </div>
        <div className="text-[#111010] text-7xl pr-28 md:text-3xl">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut lobortis ante sit amet neque tristique rutrum. Nullam a suscipit ex.</div>
      </div>
    </section>
  );
};
export default StoryProducts;
